To implement a queue using two stacks in Python, we'll follow these steps:

1. **Initialization**: Create two stacks, `stack1` and `stack2`.
2. **Enqueue Operation**: To add an element to the queue, we'll push it onto `stack1`.
3. **Dequeue Operation**: To remove an element from the queue, we'll follow these steps:
   - If `stack2` is empty, we'll pop all elements from `stack1` and push them onto `stack2`. This reverses the order of elements, making the last element of `stack1` the first element of `stack2`, which is the front of the queue.
   - Then, we'll pop the top element from `stack2`, which is the front of the queue.

Here's the implementation:

```python
class QueueUsingStacks:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def enqueue(self, item):
        """Add an item to the queue."""
        self.stack1.append(item)

    def dequeue(self):
        """Remove and return the front item from the queue."""
        if not self.stack2:
            # If stack2 is empty, move all elements from stack1 to stack2
            while self.stack1:
                self.stack2.append(self.stack1.pop())
        if self.stack2:
            # Pop the front element from stack2
            return self.stack2.pop()
        else:
            # If both stacks are empty, the queue is empty
            return None

    def is_empty(self):
        """Check if the queue is empty."""
        return not self.stack1 and not self.stack2

    def peek(self):
        """Return the front item from the queue without removing it."""
        if not self.stack2:
            while self.stack1:
                self.stack2.append(self.stack1.pop())
        if self.stack2:
            return self.stack2[-1]
        else:
            return None

